  `zt` varchar(1) NOT NULL COMMENT '事故状态',
  `sgbz` varchar(200) DEFAULT NULL COMMENT '事故备注',
  `tbbz` varchar(200) DEFAULT NULL COMMENT '通报备注',
  PRIMARY KEY (`sg_id`),
  KEY `aq_sg_info_fk` (`lrr`),
  CONSTRAINT `aq_sg_info_fk` FOREIGN KEY (`lrr`) REFERENCES `pl_user` (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

