-- ----------------------------
-- View structure for `aq_yh_yhjc_v`
-- ----------------------------
DROP VIEW IF EXISTS `aq_yh_yhjc_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `aq_yh_yhjc_v` AS select `a`.`yh_id` AS `yh_id`,`a`.`yhmc` AS `yhmc`,`a`.`yhlb` AS `yhlb`,`a`.`yhms` AS `yhms`,`a`.`yhjb` AS `yhjb`,`a`.`yhdw` AS `yhdw`,`a`.`yhdd` AS `yhdd`,`a`.`lrr` AS `lrr`,`a`.`lrsj` AS `lrsj`,`a`.`zt` AS `zt`,`a`.`ly` AS `ly`,`b`.`jcdw` AS `jcdw`,`b`.`jclx` AS `jclx`,`b`.`jcsj` AS `jcsj`,`b`.`jcr` AS `jcr`,`b`.`jcrxm` AS `jcrxm` from (`aq_yh_info` `a` join `aq_yh_yhjc` `b`) where (`a`.`yh_id` = `b`.`yh_id`);

-- ----------------------------
-- View structure for `aq_yh_yhsg_v`
-- ----------------------------
DROP VIEW IF EXISTS `aq_yh_yhsg_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `aq_yh_yhsg_v` AS select `a`.`yh_id` AS `yh_id`,`a`.`yhmc` AS `yhmc`,`a`.`yhlb` AS `yhlb`,`a`.`yhms` AS `yhms`,`a`.`yhjb` AS `yhjb`,`a`.`yhdw` AS `yhdw`,`a`.`yhdd` AS `yhdd`,`a`.`lrr` AS `lrr`,`a`.`lrsj` AS `lrsj`,`a`.`zt` AS `zt`,`a`.`ly` AS `ly`,`b`.`fxdw` AS `fxdw`,`b`.`fxr` AS `fxr`,`b`.`fxrxm` AS `fxrxm`,`b`.`yhdd` AS `yhdd_sg`,`b`.`yhms` AS `yhms_sg`,`b`.`djr` AS `djr`,`b`.`djsj` AS `djsj`,`b`.`hzr` AS `hzr`,`b`.`hzrxm` AS `hzrxm`,`b`.`hzsj` AS `hzsj`,`b`.`jiangjin` AS `jiangjin`,`b`.`sgzt` AS `sgzt` from (`aq_yh_info` `a` join `aq_yh_yhsg` `b`) where (`a`.`yh_id` = `b`.`yh_id`);

-- ----------------------------
-- View structure for `aq_yh_zgjl_v`
-- ----------------------------
DROP VIEW IF EXISTS `aq_yh_zgjl_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `aq_yh_zgjl_v` AS select `a`.`yh_id` AS `yh_id`,`a`.`yhmc` AS `yhmc`,`a`.`yhlb` AS `yhlb`,`a`.`yhms` AS `yhms`,`a`.`yhjb` AS `yhjb`,`a`.`yhdw` AS `yhdw`,`a`.`yhdd` AS `yhdd`,`a`.`lrr` AS `lrr`,`a`.`lrsj` AS `lrsj`,`a`.`zt` AS `zt`,`a`.`ly` AS `ly`,`b`.`zg_id` AS `zg_id`,`b`.`zgr` AS `zgr`,`b`.`zgrxm` AS `zgrxm`,`b`.`zgcs` AS `zgcs`,`b`.`kssj` AS `kssj`,`b`.`sqsx` AS `sqsx`,`b`.`pzsx` AS `pzsx`,`b`.`zgbz` AS `zgbz`,`b`.`fcfcr` AS `fcfcr`,`b`.`fcfcrxm` AS `fcfcrxm`,`b`.`fcsj` AS `fcsj`,`b`.`fcfcbz` AS `fcfcbz`,`b`.`gsfcr` AS `gsfcr`,`b`.`gsfcrxm` AS `gsfcrxm`,`b`.`gsfcsj` AS `gsfcsj`,`b`.`gsfcbz` AS `gsfcbz`,`b`.`zgjg` AS `zgjg` from (`aq_yh_info` `a` join `aq_yh_zgjl` `b`) where (`a`.`yh_id` = `b`.`yh_id`);

