-- ----------------------------
-- View structure for `pl_limit_v`
-- ----------------------------
DROP VIEW IF EXISTS `pl_limit_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `pl_limit_v` AS select `a`.`username` AS `username`,`b`.`m_id` AS `m_id`,`b`.`m_name` AS `m_name`,`b`.`m_url` AS `m_url`,`b`.`m_title` AS `m_title`,`b`.`m_type` AS `m_type`,`b`.`m_super` AS `m_super`,`b`.`m_order` AS `m_order` from (`pl_user_limit` `a` join `pl_menu` `b`) where (`a`.`m_id` = `b`.`m_id`) union select `a`.`username` AS `username`,`c`.`m_id` AS `m_id`,`c`.`m_name` AS `m_name`,`c`.`m_url` AS `m_url`,`c`.`m_title` AS `m_title`,`c`.`m_type` AS `m_type`,`c`.`m_super` AS `m_super`,`c`.`m_order` AS `m_order` from ((`pl_user` `a` join `pl_role_limit` `b`) join `pl_menu` `c`) where ((`b`.`m_id` = `c`.`m_id`) and (`a`.`role_id` = `b`.`role_id`)) order by `username`,`m_order` desc;

-- ----------------------------
-- View structure for `pl_user_v`
-- ----------------------------
DROP VIEW IF EXISTS `pl_user_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `pl_user_v` AS select `a`.`username` AS `username`,`a`.`password` AS `password`,`a`.`role_id` AS `role_id`,`a`.`dep_id` AS `dep_id`,`a`.`name` AS `name`,`a`.`rank` AS `rank`,`a`.`create_time` AS `create_time`,`a`.`create_user` AS `create_user`,`a`.`last_login_time` AS `last_login_time`,`a`.`last_login_ip` AS `last_login_ip`,`a`.`zt` AS `zt`,`a`.`bz` AS `bz`,`a`.`zw1` AS `zw1`,`a`.`zw2` AS `zw2`,`a`.`zw3` AS `zw3`,`a`.`tel` AS `tel`,`b`.`role_name` AS `role_name`,`c`.`dep_name` AS `dep_name`,`c`.`dep_type` AS `dep_type` from ((`pl_user` `a` join `pl_role` `b`) join `pl_dep_info` `c`) where ((`a`.`role_id` = `b`.`role_id`) and (`a`.`dep_id` = `c`.`dep_id`));

-- ----------------------------
-- Function structure for `nvl`
-- ----------------------------
DROP FUNCTION IF EXISTS `nvl`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `nvl`(str1 varchar(1000), str2 varchar(1000)) RETURNS varchar(1000) CHARSET utf8
BEGIN
	if str1 = '' or str1 is null then
		return str2;
	else
		return str1;
	end if;
END
;;
DELIMITER ;
