INSERT INTO sc_rzs VALUES ('2012-12-19', '热电分厂三台锅炉运行，产汽329t/h，负荷73%，2#锅炉西包墙管泄漏，监护运行，发电机发电量13000KW.h/h，负荷51%，脱盐水1、3#反渗透运行，水箱液位8.1m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行，1#给水泵检修，1#疏水泵试泵仍漏。', '气化分厂空分运行正常，产氧36000NM3/h，负荷90%，气化A炉3.85MPa运行，氧量16000NM3/h，负荷102%，氧煤比0.62，B炉3.8MPa运行，氧量14400NM3/h，负荷92%，氧煤比0.61。02:05 磨煤C套原煤仓下料口堵煤严重，暂无法投用C磨，07:25 B套合成气洗涤塔改用变换冷凝液。17:10-17:50 B炉因给料罐料位低减负荷，21:44 B炉3#煤线断煤，B炉减负荷运行，22:08煤线恢复正常；S1201A/B堵煤处理。', '变换运行正常，低温甲醇洗净化气合格，合成、精馏运行正常。PSA:01:30—7:30缓加负荷至39000Nm3/h，24:00 PSA进气量加至48000Nm3/h。15:40硫回收液硫池检修，切除酸性气。3#解析气压缩机检修，1#CO2压缩机备用。', 'songlina', '宋丽娜', '2012-12-21 15:30:23', null);
INSERT INTO sc_rzs VALUES ('2012-12-20', '热电分厂三台锅炉运行，产汽350t/h，负荷78%，2#锅炉西包墙管泄漏，监护运行，发电机发电量15000KW.h/h，负荷60%，脱盐水1、2、3#反渗透运行，水箱液位8.2m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行。1#给水泵检修，8:00-10:40 3#锅炉2#给煤机堵煤处理。', '气化分厂空分运行正常，产氧37000NM3/h，负荷92%，气化A炉3.85MPa运行，氧量16000NM3/h，负荷102%，氧煤比0.62，B炉3.8MPa运行，氧量15700NM3/h，负荷100%，氧煤比0.7；19:31-21:08 B炉因给料罐料位低减负荷，S1201A、B已经处理完毕。', '变换运行正常，低温甲醇洗净化气合格，合成、精馏运行正常，硫回收液硫池检修。PSA:24:00 进气量加至48000Nm3/h，02:45-03:20 CO纯度波动，最低降至95%，18:51CO压缩机因触动联锁导致反喘振阀全开，CO流量降为零，乙二醇切CO气退氧，18:57 CO流量恢复正常，19:00乙二醇接CO气，加氧,21:05 CO吸附R塔10阀未关闭，导致CO纯度降至89%，21:40 CO纯度恢复正常，3#解析气压缩机回装、清油，CO压缩机入口过滤器堵。', 'songlina', '宋丽娜', '2012-12-21 15:31:46', null);
INSERT INTO sc_rzs VALUES ('2012-12-21', '热电分厂三台锅炉运行，产汽335t/h，负荷74%；2#锅炉西包墙管泄漏，3#锅炉1次风机漏油，后轴振动大监护运行；发电机发电量10000KW.h/h，负荷40%，脱盐水1、2、3#反渗透运行，水箱液位8.0m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行。1#给水泵检修，19:00—23:50 3#给水泵带压堵漏。', '气化分厂空分运行正常，产氧36000NM3/h，负荷90%，氩系统调纯；气化双炉3.85MPa运行，A炉氧量16000NM3/h，负荷103%，氧煤比0.63，B炉14:30-16:00因下煤不畅给料罐料位低减负荷至67%，19:40气化B炉加负荷至102%，氧量15800NM3/h，氧煤比0.69；16:00—23:50 1201B疏通。', '变换运行正常，低温甲醇洗净化气合格，合成、精馏运行正常，硫回收液硫池检修。PSA:24:00 进气量加至16000Nm3/h，11:10PSA减负荷，12:50CO压缩机停车处理CO压缩机进口过滤器，15:09切原料气处理CO吸附塔J塔14阀，17:20处理结束，18:10气密结束，18:45PSA开车，19:20启CO压缩机，20:40外送合格H2,21:13外送合格CO。', 'songlina', '宋丽娜', '2012-12-23 08:51:13', '乙二醇负荷43%运行，2:10C301机组跳车，退氧，3:45开C301，开始加负荷。9:30因中新停车检修，系统停车，20:40接H2，21:20接CO，23:20引氧进酯化塔，15:10分馏停止进料打循环。');
INSERT INTO sc_rzs VALUES ('2012-12-22', '热电分厂三台锅炉运行，产汽360t/h，负荷80%；2#锅炉西包墙管泄漏，3#锅炉1次风机液耦响声大监护运行；发电机发电量13000KW.h/h，负荷52%，脱盐水1、2、3#RO运行，水箱液位7.88m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行。19:10 二期污水使用消防水，21:17 锅炉1#给水泵启动试泵，23:30 因泵前后轴承振动大停泵。2#高加有漏点，已隔离，准备检修。', '气化分厂空分运行正常，产氧37000NM3/h，负荷91%，氩系统调纯；气化双炉3.85MPa运行，A炉氧量16000NM3/h，负荷103%，氧煤比0.63，B炉氧量15800NM3/h，氧煤比0.69；气化B炉1:30分S-1201B下煤管保温棉中粉煤自燃，2:00火被扑灭，2:15气化B炉因下煤不畅给料罐料位低减负荷至96%，3:03气化B炉加负荷至102%，氧量15800NM3/h，氧煤比0.69。P1401C 21:30检修完成。23日0:10气化B系列下煤不畅负荷减至6900NM3/h运行，0:40A系列减至11000NM3/h运行，1:00 A系列加负荷，1:30 B系列下煤恢复正常，赶煤3次后开始加负荷。', '变换运行正常，低温甲醇洗净化气合格，合成、精馏运行正常，硫回收液硫池检修。15:43 启动1# CO2压缩机，15:35-17:30 CO2压缩机3#机放空阀检修。 3:20分PSA开始加负荷，14:07-17:15 因逆放气罐后调节阀PV2002膜片损坏，仪表更换检修。19:40 应乙二醇要求PSA减负荷至进气量45000Nm3/h，23日0:40分因气化减负荷进气量减至20000NM3/h,1:50PSA进气量加至45000Nm3/h。', 'songlina', '宋丽娜', '2012-12-23 08:52:52', '乙二醇负荷40%运行,19:20 乙二醇C201压缩机因出口温度探头检修时引起机组防喘振阀从0%开至60%，酯化系统切气，21:20 乙二醇系统开始接CO并引氧，分馏系统运行正常。');
INSERT INTO sc_rzs VALUES ('2012-12-23', '热电分厂三台锅炉运行，产汽340t/h，负荷75.6%；发电机发电量16000KW.h/h，负荷64%，脱盐水1、2、3#RO运行，水箱液位7.1m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行。3:20 锅炉多个在线仪表点受冻不显示，10:30检修完毕，2#高加内漏待修,1#给水泵检修，2#锅炉西包墙管泄漏，3#锅炉1次风机监护运行，3#锅炉2#给煤机频繁跳车（怀疑因煤湿导致煤中水分蒸发后冷凝液滴引起短路所致）；', '气化分厂空分运行正常，产氧37000Nm3/h，负荷92.5%，氩系统调纯；气化双炉3.86MPa运行，A炉氧量16000Nm3/h，负荷103%，氧煤比0.64，B炉17:00加负荷至15900Nm3/h，氧煤比0.7，负荷102%；5:05因给料罐B料位低，B炉减负荷运行，8:15 12XV2122、12XV2120阀检修完毕。', '变换运行正常，净化气合格，合成、精馏运行正常，硫回收检修，5:05因气化减负荷，系统低负荷运行，PSA进气量降至20000Nm3/h，PSA 10:30-20:30 进气量加至46000Nm3/h，17:30 中新开始接收乙二醇解析气。', 'songlina', '宋丽娜', '2012-12-25 08:22:18', '17:30 解析气外送，系统50%负荷运行,进气量CO:11000Nm3/h,H2:29000Nm3/h。18:30 乙二醇污水改排至格栅井。');
INSERT INTO sc_rzs VALUES ('2012-12-24', '热电分厂三台锅炉运行，产汽346t/h，负荷77%，发电机运行，发电量14000kw.h/h，负荷56%，脱盐水2#、3#反渗透运行，水位7.6m，循环水1-3#汽机泵运行，2期2#、5#电泵运行，9:34增开1#电机泵，系统置换，浊度7NUT，总铁0.88mg/L，1#锅炉集汽箱东侧安全阀微漏，2#高加内漏待修,1#给水泵检修，2#锅炉西包墙管泄漏，3#锅炉1次风机监护运行。', '气化分厂空分运行正常，产氧36700NM3/h，负荷97%，氩系统调纯，液氩贮罐置换，事故氮泵运行；气化A/B炉3.9MPa运行，A炉O/C 0.63，负荷103，B炉O/C 0.71，负荷100%，气化B炉8:06因12XV2133阀打不开，降负荷，9:36负荷恢复至100%，S-1305A反冲洗管线压力表根部阀法兰漏，19:20堵漏完成，A炉激冷室液位计13LIA1001-1003检修。', '变换运行正常，净化气合格，合成、精馏运行正常，硫回收检修，8:06因气化B炉甲醇系统减负荷，9:00开始加负荷，PSA进气48000NM3/h，合格CO产品气外送,8:06因气化B炉进气量减至35000NM3/h，9:00开始加负荷，19:05 CO真空泵G泵投用，1#、3#解析气压缩机运行。', 'songlina', '宋丽娜', '2012-12-25 08:25:38', '11:00乙二醇解析气全部回收至PSA。系统55%负荷运行,进气量CO:12000Nm3/h,H2:28000Nm3/h。');
INSERT INTO sc_rzs VALUES ('2012-12-25', '热电1-3#锅炉运行，产汽350t/h，负荷78%，发电机运行，发电量14700kw.h/h，负荷59%，脱盐水2#、3#反渗透运行，水箱液位8.2m，循环水1期1-3#汽机泵运行，二期1#、2#、5#电泵运行，系统置换，浊度：8NUT，总铁：0.62mg/L，1#给水泵检修，2#高加待检，1#锅炉集汽箱东侧安全阀及对空排汽阀微露，2#锅炉包箱管微露。', '空分运行正常，产氧：37000NM3/h，负荷：92%，液氩贮槽置换，事故氮泵运行；气化A/B炉运行，A/B炉3.8 MPa运行，A炉氧煤比0.62，负荷102%，B炉氧煤比0.69，负荷103%，7:30 气化B炉洗涤塔出口远传压力表故障导致合成气部分放空。7:42 气化B炉外送压力打手动控制，开始恢复，16:07分气化B炉因粉煤给料罐料位低，下煤架桥减负荷至氧量9000NM3/h，18:10分B炉负荷提至100%。', '甲醇分厂变换，净化，合成，精馏运行正常，净化气合格，硫回收液硫池待检，16:20分由于气化原因，系统减负荷，合成气压缩机进口补高压氮气，18:10系统恢复负荷，PSA进气48000NM3/h，外送H2产品气26000NM3/h，CO产品气12000NM3/h，10:42 1#解析气气压缩机倒为2#解析气气压缩机，1#解析气压缩机换油。', 'songlina', '宋丽娜', '2012-12-26 08:35:34', '负荷61%运行。3:30因羰化系统A汽包上水法兰泄漏，系统减负荷，退氧。6:00 开始配氧，6:20 汽包漏点处理完毕，负荷逐渐恢复。');
INSERT INTO sc_rzs VALUES ('2012-12-26', '热电1-3#锅炉运行，产汽350t/h，负荷78%，发电机运行，发电量12600kw.h/h，负荷50%，脱盐水1#、2#、3#反渗透运行，水箱液位8.2m，循环水1期1-3#汽机泵运行，二期1#、2#、5#电泵运行，系统置换，浊度：7NUT，总铁：0.27mg/L，1#给水泵检修，2#高加待检，1#锅炉集汽箱东侧安全阀及对空排汽阀微露，2#锅炉包墙管微露。', '空分运行正常，产氧：37400NM3/h，负荷：94%，液氩贮槽积液，事故氮泵运行；气化A/B炉运行，A/B炉3.86 MPa运行，A炉氧煤比0.63，负荷102%，B炉氧煤比0.69，负荷102%，5:10因气化B磨机清扫链条故障及A磨机PLC故障，气化A炉减负荷至71%，用氧11000Nm3/h,10:10A磨处理好，10:20-11:00气化A炉加至100%负荷，11:50空分高压氧泵A电流突然升高，切为B泵运行，A泵检修，16:10气化A炉负荷加至102%，B系列称重给煤机检修。', '甲醇分厂变换，净化，合成，精馏运行正常，净化气合格，硫回收液硫池待检，PSA进气53000NM3/h，外送H2产品气26000NM3/h，CO产品气13000NM3/h，23:00分CO产品气中H2含量0.8%，1#解析气压缩机换油结束。', 'songlina', '宋丽娜', '2012-12-27 08:50:57', '乙二醇运行正常，负荷55%。');
INSERT INTO sc_rzs VALUES ('2012-12-27', '热电1-3#锅炉运行，产汽345t/h，负荷77%，发电机运行，发电量13000kw.h/h，负荷52%，脱盐水1#、2#、3#反渗透运行，水箱液位7.9m，循环水1期1-3#汽机泵运行，二期1#、2#、5#电泵运行。1#锅炉集汽箱东侧安全阀及对空排汽阀微漏，2#锅炉包墙管微漏。10:00循环水二期补缓蚀阻垢剂，10:40 1#高压给水泵启动试泵，11:30 因泵前、泵后水平振动大停泵检修。17:25发电汽轮机低抽阀实际开度从55%升至82%，造成3.8MPa蒸汽管网压力超压，17:29管网压力恢复。', '空分运行正常，产氧：37400NM3/h，负荷：93%，液氩贮槽积液，事故氮泵运行；气化A/B炉运行，A/B炉3.86 MPa运行，A炉氧煤比0.65，负荷102%，B炉氧煤比0.70，负荷102%，1:30 B磨煤系统清扫链检修完毕，2:25 B套磨煤机投用，3:10 停B磨煤机（有异响），11:02 B炉3#煤线断煤，降负荷及氧煤比，11:10恢复,，17:30 B套磨煤机投用。', '甲醇分厂变换，净化，合成，精馏运行正常，净化气合格，硫回收液硫池待检，PSA进气53000NM3/h，外送H2产品气30000NM3/h，CO产品气13000NM3/h，21:00 CO产品气中H2含量0.55%。', 'songlina', '宋丽娜', '2012-12-28 09:29:34', '乙二醇运行正常，负荷60%。');
INSERT INTO sc_rzs VALUES ('2012-12-28', '热电1-3#锅炉运行，产汽362t/h，负荷81%；发电机运行，发电量14300kw.h/h，负荷57%；脱盐水1#、2#、3#反渗透运行，水箱液位7.1m；循环水1期1-3#汽机泵运行；二期1#、2#、5#电泵运行，系统预膜。1#锅炉集汽箱东侧安全阀及对空排汽阀微漏，2#锅炉包墙管微漏。 1#高压给水泵检修，2#高加待检。23:20左右1#锅炉东侧冷渣机插板阀下缓冲槽至冷渣机间微量喷渣，检修。', '空分液氧泵B 01:00—04:06轴承温度由42℃上升至83℃，04:10—05:40轴承温度由83℃降至42℃。04:28气化A炉3#煤线断煤，减负荷；04:24—07:00气化A炉激冷室液位计检修，07:40气化A炉O/C高高联锁解除；9:00—13:00气化A炉提负荷至100%，21:20流量计厂家将A炉3#煤线流量计参数进行调整，已投上，29日继续调校。A炉氧煤比0.71，负荷103%，B炉氧煤比0.72，负荷102%。', '04:28因气化A炉减负荷，各系统减负荷运行,13:00 各系统负荷恢复。变换，净化，合成，精馏运行正常，净化气合格，硫回收液硫池待检，23:20 PSA因乙二醇要求进气量减至48000NM3/h，外送H2产品气29000NM3/h，CO产品气13400NM3/h，21:00 CO产品气中H2含量0.46%、CH4含量0.73%。', 'songlina', '宋丽娜', '2012-12-29 08:43:15', '乙二醇57%负荷运行，CO产品气量14500NM3/h，H2产品气量29000NM3/h，H2和CO产品气均有放空，系统稳定运行。');
INSERT INTO sc_rzs VALUES ('2012-12-29', '热电3台锅炉运行，产汽量352t/h，负荷77%，发电量14000kw.h，负荷56%。脱盐水1#、2#RO运行，水箱水位8.1m。循环水一期1#、2#、3#汽机泵运行，二期1#、2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油较大，监护运行。6:30热电3#锅炉一次风机转速测点与轴承摩擦气火花，仪表拆除测点。21:40 停金山化工脱盐水。', '空分运行正常，产氧量37400NM3/h，负荷93%，B液氧泵监护运行。气化双炉3.86MPa运行，A炉O/C 0.73，负荷103%，B炉O/C 0.68，负荷101%。00:57分，气化B炉由于捞渣机B链条脱落减负荷，1:30降至62%,在4:21捞渣机链条检修好，但张紧装置无法工作，故5:07气化B炉负荷加至70%观察捞渣机运行情况。12:40 捞渣机链条修好，13:20 负荷加至100%。18:15 气化B炉因下煤不畅减负荷运行至氧量12400NM3/h，19:30 负荷开始恢复。', '变换、低温甲醇洗运行正常，合成、精馏低负荷运行，PSA进气量47000NM3/h。 1:30分PSA进气应乙二醇要求降至44000NM3/h，2:22分合成气压缩机2级压缩防喘振阀关小，PSA进气减至35000,CO产品气纯度下降，外送CO量8000NM3/h，2:47原料气量恢复44000NM3/h，3:00分CO外送量缓慢增长，纯度97.62%。', 'songlina', '宋丽娜', '2012-12-30 08:40:02', '乙二醇CO流量13000NM3/h，H2流量30000NM3/h，O2流量3000NM3/h，色度<5，透光率68%，60%负荷，运行正常，29日1:30分CO产品气下降，2:30分CO产品气降至最低8000,3:50分CO产品气流量恢复至11500 NM3/h');
INSERT INTO sc_rzs VALUES ('2012-12-30', '热电3台锅炉运行，产汽量337t/h，负荷75%，发电量12800kw.h，负荷51%。脱盐水1#、2#、3#RO运行，水箱水位8m。10:05-10:55脱盐水运行系统下载调整，系统制水暂时停运，12:10-15:50 3#超滤化学清洗，循环水一期1#、2#、3#汽机泵运行，二期1#、2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油较大，监护运行。', '空分运行正常，产氧量37200NM3/h，负荷98%，B液氧泵监护运行。21:40停事故氮泵。气化双炉3.9MPa运行，A炉O/C 0.72，负荷103%，B炉O/C 0.68，负荷101%。23:40 B套V1203下煤不畅，减负荷运行，O2由15800降至11000NM3，12:30 B套V1203下煤畅通，气化B炉开始加负荷,', '变换、低温甲醇洗运行正常，合成、精馏低负荷运行，硫回收检修。PSA进气量54000NM3/h。 21:00分析净化气COS 0.15ppm.', 'songlina', '宋丽娜', '2012-12-31 14:09:10', '乙二醇CO流量14000NM3/h，H2流量33000NM3/h，O2流量3400NM3/h，70%负荷，产品质量：一等品。');
INSERT INTO sc_rzs VALUES ('2012-12-31', '热电3台锅炉运行，产汽量340t/h，负荷76%，发电量14000kw.h，负荷56%。脱盐水1#、2#RO运行，水箱水位7.6m。循环水一期1#、2#、3#汽机泵运行，二期1#、2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油较大，监护运行。17:00 3#深井泵修好备用，污水事故水池液位高。', '空分运行正常，产氧量37000NM3/h，负荷98%，液氧泵B监护运行，向氩贮槽采出液氩。气化A炉3.9MPa运行，A炉O/C 0.7，负荷104%，气化B炉3.91MPa运行，B炉O/C 0.67，负荷100%。由于气化B炉带水严重，11:00 气化B炉氧量减至15500NM3/H。', '变换、低温甲醇洗运行正常，合成、精馏低负荷运行，硫回收检修。19:26低温甲醇洗开始硫浓缩；PSA进气量52000NM3/h；17:00净化气总硫未检出；22:20精馏产出精甲醇进V2801A罐。', 'songlina', '宋丽娜', '2013-01-01 11:16:29', '乙二醇CO流量13000NM3/h，H2流量33000NM3/h，O2流量3400NM3/h，65%负荷，产品质量：一等品。');
INSERT INTO sc_rzs VALUES ('2013-01-01', '热电3台锅炉运行，产汽量340t/h，负荷76%，发电量10700kw.h，负荷42%。脱盐水2#、3#RO运行，水箱水位7.8m.循环水一期1#、2#、3#汽机泵运行，二期2#、5#电泵运行,14:55停2期1#循环水电泵.锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油，监护运行,13:35-14:35分B空压机试运行，15:30分循环水2期预膜完成，停止加药.污水处理事故水池液位高.', '空分运行正常，产氧量37000NM3/h，负荷98%，液氧泵B特护运行，19:50  分子筛加热器进口阀门KV4212仪表空气管断，纯化系统暂停，21:00 阀门检修完成，纯化系统运行.20:50  因气化A炉破渣机密封漏，A气化炉停运，气化B炉3.84MPa运行，O/C 0.7，负荷95%.', '20:50  变换、低温甲醇洗、合成低负荷运行，20:20  精馏停运，酸性气浓缩，21:00分析硫化氢浓度7%，硫回收检修，21:43停氢回收，20:50因气化A炉停车，PSA减负荷运行，进气量33000NM3/h，氢气外送18000NM3/h，CO外送8500NM3/h', 'caolisheng', '曹力升', '2013-01-02 16:24:59', '19:27  乙二醇开始减负荷，CO流量8500NM3/h，H2流量18000NM3/h，O2流量1800NM3/h，35%负荷，产品质量：一等品.');
INSERT INTO sc_rzs VALUES ('2013-01-02', '热电1-3#锅炉运行，产汽330T/h，负荷73%，发电机运行，发电量11000KW.h/h，负荷44%，脱盐水1#、2#RO运行，水位8.14m，循环水一期1-3#汽机泵运行，二期2#、5#电泵运行，系统置换，8:00脱盐水3#反渗透换膜，20:00开始化学清洗，锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油，监护运行', '空分运行，产氧37500NM3/h，负荷94%，氧泵B监护运行，气化A/B炉3.86MPa，A炉氧量16200Nm3/h，O/C0.7，负荷104%，气化B炉氧量15200NM3/h，O/C0.69，负荷97.5%，03:14气化A炉破渣机检修完毕，03:50气化A炉走吹扫程序，05:45气化A炉点火成功。06:12气化A炉投煤成功，开始加负荷，9:40-10:00气化A炉并气，12:38B炉因氧煤比高高联锁跳车，16:10分B炉点火成功，18:04分气化B炉并气，20:26气化B炉加负荷至氧量15200NM3/h', '18:04甲醇变换，低温甲醇洗，合成开始加负荷运行，04:00启动2#CO2压缩机,8:20-8:50由于变换除氧器远传液位计显示不准确，造成除氧器断水，P-2003泵打不上量，由于气化并气速度较快，低温甲醇洗净化气中总硫超标，21:00净化气分析总硫合格，酸性气浓缩21:00分析硫化氢含量为25%，22:58精馏开车；PSA进气42000NM3/h，CO产品气外送流量10000NM3/h，H2产品气外送流量22000NM3/h', 'zhaoyun', '赵昀', '2013-01-03 10:33:31', '乙二醇10:30加负荷，12:40减负荷，20:10因CO产品气CH4高减负荷至20%，22:00CO产品气合格开始加负荷至55%，CO流量10000NM3/h，H2流量22000NM3/h，O2流量2500NM3/h');
INSERT INTO sc_rzs VALUES ('2013-01-03', '热电1-3#锅炉运行，产汽340t/h,负荷75%，发电机运行，发电量14000KW.h/h，负荷56%，脱盐水3#RO运行，水箱液位7.6m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行,锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油，监护运行', '空分运行正常，产氧量37000NM3/h，负荷93%，氧泵B泵监护运行，气化A/B炉3.88MPa运行，A炉氧量16200NM3/h，负荷103%，O/C:0.71，B炉氧量15300NM3/h，负荷99%，O/C:0.69，14FV0003A阀微露，现场检修', '甲醇变换，低温甲醇洗，合成，精馏稳定运行，PSA进气量35000NM3/h，CO外送9000NM3/h，H2外送，21000NM3/h，精馏污水管线堵塞，9:00 PSA进气量逐渐增加,10:40 2#CO2压缩机一段缸异响（十字头坏），紧急停车，11:10三号CO2压缩机启动，17:04一氧化碳吸附塔J塔进口阀门法兰外漏，切J塔，导致CO外送量急剧减少，19:10因为乙二醇解析气带液，2#解析气压缩机异常，停2#压缩机，20:24乙二醇切解析气，20:35启1#解析气压缩机', 'songlina', '宋丽娜', '2013-01-04 09:37:51', '17:15因PSA波动切CO产品气，系统退氧停车，17:20 CO进系统，配氧，18:10接CO产品气加量，22:25开始加CO流量，23:00开始加氧气流量。CO流量8500NM3/h，H2流量21000NM3/h，O2流量2000NM3/h');
INSERT INTO sc_rzs VALUES ('2013-01-04', '热电1-3#锅炉运行，产汽352t/h，负荷77%，发电机运行，发电量14000KW.h/h，负荷56%，脱盐水1#、2#RO运行，水箱液位8.1m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行,3#炉主汽流量计故障检修,19:35-21:50处理3#锅炉输灰阀，处理期间3#除尘器走旁路。', '空分运行正常，产氧量37000NM3/h，负荷93%，氧泵B泵监护运行，气化A/B炉3.88MPa运行，A炉氧量16200NM3/h，负荷103%，O/C:0.71，B炉氧量15200NM3/h，负荷98%，O/C 0.69，14FV0003A阀微露，现场检修,13:30-15:00二楼过滤机更换滤布。', '甲醇变换，低温甲醇洗，合成，精馏稳定运行，精馏污水管线堵塞；PSA进气量40000NM3/h，CO外送1000NM3/h，H2外送，21000NM3/h，21:30因PSA系统压力下降，操作未及时调整，导致外送H2流量下降，21:40外送H2流量恢复，16:40 2#解析气压缩机试车，因一段缸异响，停车处理，2#CO2压缩机待修', 'songlina', '宋丽娜', '2013-01-05 09:30:56', '9.8MPa蒸汽管导淋根部漏汽,CO流量10000NM3/h，H2流量24000NM3/h，脱氢加氧36NM3/h，酯化配氧2600NM3/h。');
INSERT INTO sc_rzs VALUES ('2013-01-05', '热电1-3#锅炉运行，产汽350t/h,负荷77%，发电机运行，发电量14000KW.h/h，负荷56%，脱盐水1#、2#RO运行，水箱液位8.1m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽', '空分运行正常，产氧量37100NM3/h，负荷93%，氧泵B泵监护运行，气化A/B炉3.88MPa运行，A炉氧量16200NM3/h，负荷103%，O/C 0.71，B炉氧量15200NM3/h，负荷98%，O/C 0.70，03:35-10:00气化S1201B落煤管堵塞处理,23:50 A炉捞渣机因张紧装置液压油管裂开跳车，空分增压机一、二段出口漏汽，停车后处理', '甲醇变换，低温甲醇洗，合成，精馏稳定运行，精馏污水管线堵塞；PSA进气量50000NM3/h，CO外送13000NM3/h，H2外送，29000NM3/h，2#解析气压缩机检修，2#CO2压缩机待修', 'songlina', '宋丽娜', '2013-01-06 11:09:21', 'CO流量13000NM3/h，H2流量31000NM3/h，系统65%负荷运行，9：42 乙二醇因酯化A塔氧气流量超标引起氧阀关闭，导致氧气用量由2630Nm3/h退至750Nm3/h,10:20恢复正常，20:00增加1000NM3/h氧气流量。界内高压蒸汽倒淋根部漏汽');
