INSERT INTO sc_rzs VALUES ('2013-01-13', '热电分厂三台锅炉运行，产汽360t/h，负荷80%，发电机运行，发电量15000KW.h/h，负荷60%，脱盐水1#、3#RO运行，脱盐水箱液位7.7m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行，锅炉1#给水泵待修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽。17:20 因1#除尘器旁路阀故障，烟气走旁路，并更换输灰管线，19:00 旁路阀修好。', '空分运行正常，产氧37000NM3/h，负荷92%，气化A/B炉3.88MPa运行，A炉：O/C 0.78，氧量16200 NM3/h，负荷103%，B炉：O/C 0.71，氧量15200NM3/h，负荷98%，22:00因耙料机电流高，沉降槽导淋间断开。', '甲醇分厂变换，低温甲醇洗，合成，精馏运行正常，1:50PSA加负荷至49000Nm3/h，3:30PSA减负荷至45000Nm3/h，CO外送12000NM3/h，H2外送25000NM3/h，18:00 CO吸附J塔切塔，检查阀门，22:00-0:00因CO压缩机进口过滤器压差大，外送流量减至10000NM3/h。CO2压缩机2#机待检，H2真空泵D泵待检。', 'songlina', '宋丽娜', '2013-01-14 09:02:04', 'CO流量12000NM3/h，H2流量28000NM3/h，O2流量2900NM3/h。系统60%负荷运行,乙二醇质量：一等品。');
INSERT INTO sc_rzs VALUES ('2013-01-14', '热电分厂三台锅炉运行，产汽360t/h，负荷80%，发电机运行，发电量15000KW.h/h，负荷60%，脱盐水1#、3#RO运行，脱盐水箱液位7.7m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行，锅炉1#给水泵待修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽。21:50-23:00乙二醇废水排格栅井进调节池（调节PH）。', '空分运行正常，产氧36800NM3/h，负荷92%，气化A/B炉3.9MPa运行，A炉：O/C 0.74，氧量16000 NM3/h，负荷103%，19:00—21:00气化B炉提负荷至100%，O/C 0.71，氧量15500NM3/h，0:20因耙料机电流高开导淋排，P1404C泵不打量待检。', '甲醇分厂变换，低温甲醇洗，合成，精馏运行正常；1:00 PSA进气量减至43000Nm3/h，11:00 CO吸附塔J塔投用，16:30—20:30进气量减至32000Nm3/h，外送CO量8000Nm3/h。CO2压缩机2#机待检，H2真空泵D泵待检。', 'songlina', '宋丽娜', '2013-01-15 09:28:14', 'CO产品气流量8000NM3/h，H2产品气流量18000NM3/h，17:30因CO产品气中CH4高减至8000NM3/h。');
INSERT INTO sc_rzs VALUES ('2013-01-15', '热电分厂三台锅炉运行，产汽340t/h，负荷76%，发电机运行，发电量14500KW.h/h，负荷58%，脱盐水1#、3#RO运行，脱盐水箱液位7.8m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行，锅炉1#给水泵待修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽。01:40-02:40乙二醇废水排格栅井进调节池（调节PH）。11:20-23:00因气化污水排入雨水系统雨水系统进行置换。12:10因气化污水排入雨水系统，增开一台生产水泵。14:50二期1#电泵试运行正常。', '空分运行正常，产氧37000NM3/h，负荷92%，气化A/B炉3.88MPa运行，A炉：O/C 0.77，氧量16000 NM3/h，负荷103%，气化B炉O/C 0.73，氧量15350NM3/h，负荷99%，16:32气化A炉减O2至15700NM3/H,17:50A炉加O2至16000NM3/H。00:50耙料机电流降至3.6，P1404C泵清洗后仍然不打量待修', '甲醇分厂变换，低温甲醇洗，合成，精馏运行正常；09:05-15:25硫回收因1#液硫锁斗加盲板处理漏点退酸性气，13:38-15:10 PSA CO吸附塔K塔切除查漏查出12阀内漏，17:00-17:50 CO吸附塔L塔切除查漏（无漏点）16:30-18:30PSA进气量由32000Nm3/h增加至38000Nm3/h。CO2压缩机2#机待检，H2真空泵D泵待检。', 'songlina', '宋丽娜', '2013-01-16 10:38:54', '系统CO进气量9500Nm3/h,H2进气量22000Nm3/h，负荷48﹪。');
INSERT INTO sc_rzs VALUES ('2013-01-16', '热电分厂三台锅炉运行，产汽363t/h，负荷80%，发电机运行，发电量11000KW.h/h，负荷44%，脱盐水1#、3#RO运行，脱盐水箱液位7.9m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行，锅炉1#给水泵待修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽。10:40发电机组退中抽。', '空分运行正常，产氧36500Nm3/h，负荷96%，气化A/B炉3.9MPa运行，A炉：O/C 0.82，氧量16200 Nm3/h，负荷103%，气化B炉O/C 0.71，氧量15580Nm3/h，负荷99%，00:10耙料机电流降至2.78，P1404三台泵运行打量50m3/h。9:58空分汽轮机中抽法兰漏气，11:40液氩停止采出。23:47-23:50气化B炉2#煤线波动一次。', '甲醇分厂变换，低温甲醇洗，合成，精馏运行正常；19:37硫回收退酸性气，系统停车氮气置换。11:00-12:00 CO吸附塔I塔切除查漏（无漏点），PSA进气量39000Nm3/h，CO外送8500Nm3/h，H2外送20000Nm3/h。CO2压缩机2#机待检，H2真空泵D泵待检。', 'songlina', '宋丽娜', '2013-01-17 09:25:33', '23:10开始退氧，1:30 退氧结束，0:58酯化塔B切氧;1:00 CO进气量减至7600Nm3/h,H2进气量减至17800Nm3/h。');
INSERT INTO sc_rzs VALUES ('2013-01-17', '热电分厂二台锅炉运行，产汽230t/h，负荷51%，发电机运行，发电量6000KW.h/h，负荷24%，脱盐水1#、3#RO运行，脱盐水箱液位7.8m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行，锅炉1#给水泵待修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉主蒸汽流量计根部阀漏汽。07:25 3#锅炉压火停炉，17:45 3#锅炉液耦找正完成，21:55 4#给水泵备用。', '空分运行正常，产氧20220NM3/h，负荷56%，气化B炉2.7MPa运行，气化B炉O/C 0.66，氧量12000NM3/h，负荷77%，01:35去永金氧气阀关闭，02:30 去永金高压空气切断，06:15停气化B炉，06:38停气化A炉，09:46空分机组停车完毕。13:31空分机组开始冲转。15:24空压机转速升至4700rpm，机组正常。17:28启液氮泵B，外送高压氮气。17:35启氮压机A。17:50停事故氮泵。18:40启氧泵B，外送合格氧气。19:00—20:00气化B炉2#煤线更换流量计，19:49启氮压机B。21:27—22:40气化点火4次，点火成功。23:21投煤。', '合成机组、氨机组运行；精馏打循环。05:28 PSA切气停车，部分系统用低压氮气置换；06:25合成切气；06:28变换切气；15:10—21:30合成升温。18:20-23:55 PSA气密。21:03 启动1#CO2压缩机，00:09变换接气。00:45低温甲醇洗接气。', 'caolisheng', '曹力升', '2013-01-18 10:15:02', '1:30 退氧结束，5:28退CO、H2，6:10 C-201机组停车，6:45 C-301机组停车，系统停车检修。20:30永金暖管。');
INSERT INTO sc_rzs VALUES ('2013-01-31', '热电3台锅炉运行，产汽量340t/h，负荷76%，发电量14000kw.h，负荷56%。脱盐水1#、2#RO运行，水箱水位7.6m。循环水一期1#、2#、3#汽机泵运行，二期1#、2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油较大，监护运行。17:00 3#深井泵修好备用，污水事故水池液位高。', '空分运行正常，产氧量37000NM3/h，负荷98%，液氧泵B监护运行，向氩贮槽采出液氩。气化A炉3.9MPa运行，A炉O/C 0.7，负荷104%，气化B炉3.91MPa运行，B炉O/C 0.67，负荷100%。由于气化B炉带水严重，11:00 气化B炉氧量减至15500NM3/H。', '变换、低温甲醇洗运行正常，合成、精馏低负荷运行，硫回收检修。19:26低温甲醇洗开始硫浓缩；PSA进气量52000NM3/h；17:00净化气总硫未检出；22:20精馏产出精甲醇进V2801A罐。', 'songlina', '宋丽娜', '2013-01-01 08:58:14', '乙二醇CO流量13000NM3/h，H2流量33000NM3/h，O2流量3400NM3/h，65%负荷，产品质量：一等品。');
